/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="cybex">Cybex</h1>\n<p>Daha nce bahsedildii gibi , Graphene sadece bir <em>teknolojiyi</em> yada <em>protokol</em> \ntarif etmektedir. Fakat fiilen bir  ekosisteme dnmesi  Cybex gibi \ngerek bir blokzinciri ile birlikte mmkn olur.</p>\n<p>Cybex , blokzinciri yeniliini , hizmetlerini internet kullanarak sunan tm \nendstrilere yaymay ummaktadr. Bankaclk, hisse senedi borsalar, \npiyangolar,seimler, mzik, mezat veya birok dierleri olsun , dijital umumi bir \ndefteri-kebir, datk-otonom-irketlerin (DAC- distributed autonomous companies) \nyaratlabilmesine imkan tanr. Bu DAC lar geleneksel merkeziyeti rakiplerinin \nsunduklarndan daha kaliteli hizmetleri ok daha ucuza sunarlar.  DAClarn ortaya \nk , organizasyon yaplarnda yeni bir paradigma tekil etmektedir. Artk irketler,\nbozulamayan i kurallar altnda ve insan ynetimi olmadan ileyebilirler. Bu kurallar\nhalka ak ekilde denetlenilebilen ak kaynak bir yazlmn iine kodlanmtr ve \nirketin hissedarlarnn bilgisayarlarna datlmtr. Bu ekilde irketin keyfekeder\nmanplelerden  korunmas daha kolay olur.</p>\n<p>Bitcoin para iin ne yaptysa Cybex&#39;de iletmeler iin onu yapar. Bunu , evrensel, \neffaf, gvenilir, verimli ve karl irketler yaratmak iin datk mutabakat teknolojisini \nkullanarak yapar.</p>\n<h2 id="bu-c-zdan">Bu Czdan</h2>\n<p>u an bu tarayc penceresinde ak olan czdanla Cybex ann tm ilevlerine\neriebilirsiniz.\n<a href="../assets/mpa.md">BitAktifler</a>, <a href="../assets/uia.md">Kullanc-Srm-Varlklar</a> ve \n<a href="../dex/introduction.md">datk borsa</a>.</p>\n'},
