/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="yedeklemer">Yedeklemer</h1>\n<p>ou zaman tek bir yedekleme yeterli olsa bile czdannz dzenli bir ekilde \nyedeklemeniz nerilir. Bir yedeklemeden geri kurtarma yapabilmek iin ifre \ncmlenize ihtiyacnz olduunu unutmayn , nk <strong>yedeklemeler kriptolanmtr</strong>. \nDolaysyla , czdannz yada ifre cmlenizi kaybederseniz fonlarnza tekrar \nerimeniz imkansz olur.</p>\n<p>Yedeklere Czdan Ynetim Panelinden ulaabilirsiniz . \n(<code>Ayarlar -&gt;Czdanlar</code>).</p>\n<h2 id="c-zdan-i-hrac-">Czdan hrac</h2>\n<p>Yeni bir yedekleme oluturmann en kolay yolu Czdan Ynetim Panelinde\nverilen balantdan czdan dar ihrac etmektir. Ltfen yedeklerinizi gvenli bir \nkaybetmekten, hrszlklardan, ve doal afetlerden koruyunuz. </p>\n<h2 id="beyin-anahtar-yalnizca-geli-mi-kullan-c-lar-">Beyin-anahtar (YALNIZCA gelimi kullanclar )</h2>\n<p>Eer czdannzn iine hi hesap anahtar aktarmadysanz , alternatif olarak\n hesaplarnz ve fonlarnz dar <em>beyin-anahtar</em> ihrac ederek yedekleyebilirsiniz. \nBeyin-anahtar anahtarlarnzn deterministik yntemle tretildii bir kelimeler dizisidir.</p>\n<h2 id="dikkat-hiyerar-ik-yetkililer-sadece-uzman-kullan-c-lar-">Dikkat : Hiyerarik Yetkililer (SADECE uzman kullanclar)</h2>\n<p>Eer hiyerarik yetkiler kullanyorsanz (hesap ve/yada etkin izinler),\nsadece anahtarlar yedeklemeniz fonlarnza tekrar erimenize yeterli olmayabilir!\nLtfen hiyerarik yetkiler konusundaki dokmantasyonlar tekrar gzden geirin.</p>\n'},
