/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="graphene-yard-m">Graphene Yardm</h1>\n<p>Cybex, <a href="http://cryptonomex.com">Cryptonomex</a> tarafndan ina edilmi olan\n<a href="https://github.com/cryptonomex/graphene">Graphene</a> teknolojisine dayanan bir \nFinansal-Akll-Kontratlar platformudur. Graphene&#39;i  gerek-zamanl blokzincirleri iin \nbir ara takm yada bir teknoloji olarak da grebilirsiniz.</p>\n<p>Bu yardm blm zet bir genel bak salar ve bu uygulamann en temel \nkavramlarn tanmlar.</p>\n<h2 id="takdim">Takdim</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">Czdan</a></li>\n<li><a href="introduction/backups.md">Yedekler</a></li>\n<li><a href="introduction/blockchain.md">Blokzinciri</a></li>\n<li><a href="introduction/witness.md">Tanklar</a></li>\n<li><a href="introduction/workers.md">iler</a></li>\n<li><a href="introduction/committee.md">Kurul yeleri</a></li>\n</ul>\n<h2 id="hesaplar">Hesaplar</h2>\n<ul>\n<li><a href="accounts/general.md">Giri</a></li>\n<li><a href="accounts/permissions.md">zinler</a></li>\n<li><a href="accounts/membership.md">yelikler</a></li>\n</ul>\n<h2 id="aktifler">Aktifler</h2>\n<ul>\n<li><a href="assets/mpa.md">Piyasa Sabitli Varlklar</a> (BitUSD, BitEUR, BitGOLD, Bit*,...)</li>\n<li><a href="assets/uia.md">Kullanc Aktifleri</a></li>\n<li><a href="assets/privbitassets.md">zelletirilmi Varlklar</a></li>\n</ul>\n<h2 id="merkezsiz-da-t-k-borsa">Merkezsiz/Datk Borsa</h2>\n<ul>\n<li><a href="dex/introduction.md">Giri</a></li>\n<li><a href="dex/trading.md">Al/Sat</a></li>\n<li><a href="dex/shorting.md">BitAktif Ksa Satlar</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">Terimler</a></p>\n'},
