/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="al-sat-">Al-Sat</h1>\n<p>Bu sayfa DEX (datk borsa)de kullanlan terimlerin nasl yorumlanmas gerektii \nve al-sat elerinin nasl temsil edildiine dair hzl bir giritir.</p>\n<h2 id="-iftler-e-ler">iftler/Eler</h2>\n<p>Cybex&#39;de , neredeyse her aktif tm dier aktiflerle alnp-satlabilirler. ki varlk \nsemi olduumuz vakit , biz genelde <em>piyasa ifti</em> diye hitab ediyoruz. Mesela , \nUSD&#39;yi EUR&#39;a kar  USD:EUR iftinde takas edebiliriz.</p>\n<p>Tutarl olmak adna , biz <em>temel</em> ve <em>kota</em> genel terimlerini kullanacaz ,\nyleki iftler yle temsil edileceklerdir </p>\n<pre><code>*kota* : *temel*</code></pre><p>ve mesela <em>temel</em> USD olursa ve <em>kota</em> da EUR olursa biz  bunu EUR:USD ifti olarak \nbelirteceiz</p>\n<h2 id="sipari-defterleri">Sipari Defterleri</h2>\n<p>Sipari defteri <em>ask</em> (istenilen sat fiyat) ve <em>bid</em> (verilen al teklif fiyat) yanlarndan \noluur. Al-sat iftlerin tercihen bir yn olmadndan ters evirilebilirler, aadaki \ntabloda ask/bid ve her iki tarafn ilgili al/sat operasyonlarna genel bak verilmitir:</p>\n<table>\n<thead>\n<tr>\n<th>Taraf</th>\n<th>Sat</th>\n<th>Al</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Ask</td>\n<td><em>kota</em></td>\n<td><em>temel</em></td>\n</tr>\n<tr>\n<td>Bid</td>\n<td><em>temel</em></td>\n<td><em>kota</em></td>\n</tr>\n<tr>\n<td>----------</td>\n<td>-------</td>\n<td>-------</td>\n</tr>\n</tbody></table>\n<p>USD:EUR iftinin bid tarafnda olan EUR:USD iftinin ask tarafnda \nolacaktr. Tabiiki  fiyatlar kesir olarak temsil edileceinden sonuta her iki ift ayn \nolacaktr.</p>\n<h2 id="al-sat-">Al-Sat</h2>\n<p>Al-sat emri vermek iin , formun taraflarndan birini doldurmak \ngereklidir,  ya <em>ask</em>, yada <em>bid</em> taraf ( <em>al</em> yada <em>sat</em> taraf) . Satmak/almak iin bir \n<em>fiyat</em> ve bir <em>miktar</em> belirlemeniz gerekecektir. Bu emrin maliyeti otomatik olarak \nhesaplanacaktr. \nBu emrin verilmesi iin ilave cret gerekecektir.</p>\n<p>Emir icra edildiinde (biri teklifinizi sattnda/aldnda) , hesabnza sz konusu \nvarlktan yatrlacaktr.</p>\n<p>Yerine getirilmemi emirler herhangi bir zamanda iptal edilebilirler.</p>\n'},
