/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="kullan-c-s-r-m-aktifler-uia-user-issued-assets-">Kullanc Srm Aktifler (UIA-User Issued Assets)</h1>\n<p>Daha nce bahsedilen <em>piyasaya sabitli varlklarn</em> yansra , Cybex bireylere ve \nirketlere, hayal edebilecekleri hereye ait  kendi kuponlarn yaratma ve piyasaya \nsrme imkan verir. Kullanc Srm Varlklar (UIA) iin potansiyel kullanm alanlar \nsayszdr. Bir tarafta UIA&#39;ler mterilerin telefonlarna konser girilerinde \nkullanabilecekleri basit organizasyon biletleri olarak yklenebilirler. Dier tarafta ise \nkitle fonlamas, mlkiyet takibi , ya da hisse eklinde irket zsermayesi satnda bile \nkullanlabilirler.</p>\n<p>Tabiiki, her tr kupona uygulanan kurallar eitlidir  ve her yetki blgesinde farkllk \ngsterir. Dolaysyla Cybex,  varlklar piyasaya srlrken , piyasaya sren kiinin \ngeerli kanunlar erevesinde korunmasna yardmc olacak aralarla gelir -kanunlarn \nbyle varlklara zaten izin verdiini farz ediyoruz.</p>\n'},
