/*! no static exports found */
/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="piyasa-sabitli-aktifler-mpa-market-pegged-assets-">Piyasa Sabitli Aktifler (MPA-Market Pegged Assets)</h1>\n<p>Bitcoin&#39;e benzeyen zelliklerde ve avantajlarda, amerikan Dolar gibi tm dnya\ntarafndan benimsenmi bir parayla pariteyi koruyabilen bir kripto-parann\n sansrsz ve kolay bir ticaret iin ok faydas vardr. Bu, Cybex&#39;in \npiyasaya  sabitli varlklar (MPA) sayesinde mmkn olur. Bunlar, serbeste \nalp-satlabilen yeni  bir tr dijital varlklardr. Bunlarn deerleri, fark-kontrat (CFD) yntemiyle\ndayandklar geleneksel varlklarn deerlerini takip etmek zere dizayn edilmilerdir. </p>\n<p><em>AkllPara</em> (eanlam MPA) , deerinin  <em>daima</em>  100% yada daha fazlas Cybex&#39;in \n ana para birimi (CYB) ile desteklenen bir kripto-paradr. Bu <em>AkllParalar</em> herhangi bir \nzamanda bir fark-kontrat (CFD) iinde <em>teminat</em> olarak CYB&#39;ye dntrlebilirler .</p>\n<p>Teminatla desteklenen FK&#39;n andrmalarna ramen PSV&#39;leri nadir yapan ey \nonlarn  kar taraf riskinden muaf olmalardr. Bunun mmkn olmas iin teminat \ngvence  altna alma ve hesap grme ilemleri an  kendi sorumluluuna braklmtr<br>(yazlm protokolyle uygulanarak) . Bu konunun detaylar aada\nanlatlacaktr.</p>\n<p>Bu, piyasaya-sabitli-varlklarn mevcut bir alt kmesidir:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n'},
