/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<h1 id="graphene-help">Graphene Help</h1>\n<p>Cybex is a Financial Smart Contracts platform that is based on the\n<a href="https://github.com/cryptonomex/graphene">Graphene</a> technology built by\n<a href="http://cryptonomex.com">Cryptonomex</a>. You can see Graphene as a toolkit or\ntechnology for real-time blockchains.</p>\n<p>This help section gives a brief overview and describes the most basic concepts\nof this application.</p>\n<h2 id="introduction">Introduction</h2>\n<ul>\n<li><a href="introduction/cybex.md">Cybex</a></li>\n<li><a href="introduction/wallets.md">Wallet</a></li>\n<li><a href="introduction/backups.md">Backups</a></li>\n<li><a href="introduction/blockchain.md">Blockchain</a></li>\n<li><a href="introduction/witness.md">Witnesses</a></li>\n<li><a href="introduction/workers.md">Workers</a></li>\n<li><a href="introduction/committee.md">Committe Members</a></li>\n</ul>\n<h2 id="accounts">Accounts</h2>\n<ul>\n<li><a href="accounts/general.md">Introduction</a></li>\n<li><a href="accounts/permissions.md">Permissions</a></li>\n<li><a href="accounts/membership.md">Memberships</a></li>\n</ul>\n<h2 id="assets">Assets</h2>\n<ul>\n<li><a href="assets/mpa.md">Market Pegged Assets</a></li>\n<li><a href="assets/uia.md">User Issued Assets</a></li>\n<li><a href="assets/privbitassets.md">Privatized BitAssets</a></li>\n</ul>\n<h2 id="decentralized-exchange">Decentralized Exchange</h2>\n<ul>\n<li><a href="dex/introduction.md">Introduction</a></li>\n<li><a href="dex/trading.md">Trading</a></li>\n<li><a href="dex/shorting.md">Short Selling BitAssets</a></li>\n</ul>\n<hr>\n<p><a href="glossary.md">Glossary</a></p>\n'},
