/*! all exports used */
/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(e,t){e.exports='<p>[# receive]</p>\n<h3 id="receiving-cyb">Receiving CYB</h3>\n<p>In order to receive CYB from another person or from an exchange, simply give them your account name: <strong>{account}</strong></p>\n<p>[# deposit-short]</p>\n<h3 id="depositing-or-withdrawing-coins">Depositing or withdrawing coins</h3>\n<p>If you want to deposit or withdraw funds, either in fiat or from other blockchains, you may use a <a href="introduction/bridges_gateways">bridge</a> or <a href="introduction/bridges_gateways">gateway</a> service to do so.</p>\n'},
